import React, { Component } from "react";
import Link from "react-scroll";

export default class Navbar extends Component {
  render() {
    return (
      <>
      <nav className="nav" id="navbar">
        <div className="nav-content">
          
          
    <Link
    activeClass="active"
    to="Home"
    spy={true}
    smooth={true}
    offset={-70}
    duration={500}
>Home</Link>

<Link
    activeClass="active"
    to="Service"
    spy={true}
    smooth={true}
    offset={-70}
    duration={500}
>service</Link>
         
        </div>
      </nav>
      </>
    );
  }
}
